import  React, { Component } from 'react';

class FourSection extends Component {
    render () {
        return (
                <div class="jumbotron">
                    <h2 class="display-4 titlefour">Ipsum feugiat consequat?</h2>
                    <hr/>
                    <p>Sed lacus nascetur ac ante amet sapien.</p>
                    <p class="lead row">
                        <a class="btn btn-lg btnactive col-lg-5" href="#" role="button">Sign up</a>
                        <a class="btn btn-primary btn-lg btnnormal" href="#" role="button">Learn more</a>
                    </p>
                </div>
        )
    }
}
export default FourSection;
